use bevy_ws_server::{ReceiveError, WsConnection, WsListener};
use log::info;
use serde_json::json;

use std::fmt::Debug;

use bevy::prelude::*;
use serde::{Deserialize, Serialize};

const TEMP_IMG_BASE64 : &str = "data:image/jpeg;base64,";

#[derive(Debug, Serialize, Deserialize)]
pub struct ServerMsg<T> {
    data: Option<T>,
    error: Option<String>,
}

impl<T: ToString> ServerMsg<T> {
    pub fn data(data: T) -> Self {
        Self { data: Some(data), error: None }
    }

    pub fn error(error: T) -> Self {
        let err_msg = error.to_string();
        log::warn!("Server error. {err_msg:?}");
        Self { data: None, error: Some(err_msg) }
    }
}

#[derive(Clone, Resource)]
pub struct ShutdownBevyRemotely {
    tx: crossbeam_channel::Sender<bool>,
    rx: crossbeam_channel::Receiver<bool>,
}

impl FromWorld for ShutdownBevyRemotely {
    fn from_world(_world: &mut World) -> Self {
        let (tx, rx) = crossbeam_channel::unbounded::<bool>();
        Self { tx, rx }
    }
}

pub struct RoomData {
    pub stream_frame_data: crate::StreamingFrameData,
}

pub fn start_ws(listener: Res<WsListener>) {
    let port = std::env::var("PORT")
        .unwrap_or_else(|_| "8080".to_string())
        .parse::<u16>()
        .expect("PORT couldn't be set");
    info!("starting HTTP server on port {port}");

    match listener.listen(([127, 0, 0, 1], port), None) {
        Ok(host) => {
            log::info!("Websocket Server listening on {host:?}");
        },
        Err(e) => {
            log::error!("error starting WS listener: {e}");
        },
    };
}

pub fn receive_message(mut commands: Commands, connections: Query<(Entity, &WsConnection)>) {
    for (entity, conn) in connections.iter() {
        loop {
            match conn.receive() {
                Ok(message) => {
                    info!("message | {message:?}");
                    let resp = tungstenite::protocol::Message::Text(
                        json!({
                            "images": [TEMP_IMG_BASE64]
                        })
                        .to_string(),
                    );
                    conn.send(resp);
                },
                Err(ReceiveError::Empty) => break,
                Err(ReceiveError::Closed) => {
                    commands.entity(entity).despawn();
                    break;
                },
            }
        }
    }
}
